import React from 'react';
import WeatherIncons from 'react-weathericons';

const WeatherTemperature = ({temperature, weatherState}) => (


    <div>
        <span>
            <WeatherIncons name="" size="2x"></WeatherIncons>
             {temperature + "°C"}
            </span>
        </div>

);

export default WeatherTemperature;
